    z-index: 10;
    background: rgba(0, 0, 0, 0.3);
    display: grid;
    place-items: center;
`
const Window = styled.div`
    background: white;
    width: 30%;
    height: 20rem;
    border-radius: 0.5rem;
    border: 1px solid #ccc;

`
const Title = styled.div`
    text-align: center;
    font-size: 1.2rem;
    padding: 0.5rem;

`
const Popup = ({setIsPopup}) => {

    return (
        <Container>
            <Window>
                <Title>Gio hang</Title>
            </Window>
        </Container>
    )
}

export default Popup
